import config from "./_apiConfig/apiConfig";
import { performRequest, apiEndPoints, methodType } from "./_apiConfig";

export const getBillList = () => {
  return performRequest(
    methodType.GET,
    config.baseURL + apiEndPoints.bill,
    {},
    true,
    false
  )
    .then((response) => {
      return response;
    })
    .catch((error) => {
      return error;
    });
};
